import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          TKC Class Schedule
        </p>
        <p>
          First Class Scheduler
        </p>
      </header>
    </div>
  );
}

export default App;
